import React, { Component } from "react";
import {
  Button,
  Text,
  View,
  StyleSheet,
  ScrollView,
  Image,
  Dimensions,
} from "react-native";
import { globalStyles } from "../styles/global";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

const { width } = Dimensions.get("window");
const height = width * 0.6;

const images = [
  "https://esportsobserver.com/wp-content/uploads/2019/12/DreamHack-2020-Schedule.jpg",
  "https://d1csarkz8obe9u.cloudfront.net/posterpreviews/pubg-game-tournament-poster-design-template-034c8b363092011715d173d7fc37da85_screen.jpg?ts=1561544991",
  "https://esportsobserver.com/wp-content/uploads/2020/06/Sponsors_KK_header_copy-e1591799792406.jpg",
  "https://rocketleague.media.zestyio.com/rl_tournaments_final.f1cb27a519bdb5b6ed34049a5b86e317.jpg",
];

const images2 = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://monkeybubble.gg/wp-content/uploads/2019/05/MB-Invitational-Banner-1600x900.png",
  "https://www.esportsph.com/wp-content/uploads/2019/03/SouThe-Biggest-Hearthstone-Tournament.jpg",
];

const images3 = [
  "https://bnetcmsus-a.akamaihd.net/cms/blog_header/11/11KHF6EDR2OE1550189836070.jpg",
  "data:image/jpeg;base64,",
  "https://monkeybubble.gg/wp-content/uploads/2019/05/MB-Invitational-Banner-1600x900.png",
  "https://www.esportsph.com/wp-content/uploads/2019/03/SouThe-Biggest-Hearthstone-Tournament.jpg",
];

class HomePage extends Component {
  state = {
    active: 0,
    active2: 0,
  };

  change = ({ nativeEvent }) => {
    const slide = Math.ceil(
      nativeEvent.contentOffset.x / nativeEvent.layoutMeasurement.width
    );
    if (slide !== this.state.active) {
      this.setState({ active: slide });
    }
  };

  render() {
    return (
      <ScrollView>
        <View style={style.container}>
          <Text>Featured Events</Text>
          <ScrollView
            pagingEnabled
            horizontal
            onScroll={this.change}
            showsHorizontalScrollIndicator={false}
            style={style.scroll}
          >
            {images.map((image, index) => (
              <Image
                key={index}
                source={{ uri: image }}
                style={style.image}
              ></Image>
            ))}
          </ScrollView>
          <View style={style.pagination}>
            {images.map((i, k) => (
              <Text
                key={k}
                style={
                  k == this.state.active
                    ? style.pagingActiveText
                    : style.pagingText
                }
              >
                •
              </Text>
            ))}
          </View>
        </View>

        <View style={style.container}>
          <Text>Upcoming Events</Text>
          <ScrollView
            pagingEnabled
            horizontal
            onScroll={this.change}
            showsHorizontalScrollIndicator={false}
            style={style.scroll}
          >
            {images2.map((image, index) => (
              <Image
                key={index}
                source={{ uri: image }}
                style={style.image}
              ></Image>
            ))}
          </ScrollView>
          <View style={style.pagination}>
            {images2.map((i, k) => (
              <Text
                key={k}
                style={
                  k == this.state.active
                    ? style.pagingActiveText
                    : style.pagingText
                }
              >
                •
              </Text>
            ))}
          </View>
        </View>

        <View style={style.container}>
          <Text>Live Events</Text>
          <ScrollView
            pagingEnabled
            horizontal
            onScroll={this.change}
            showsHorizontalScrollIndicator={false}
            style={style.scroll}
          >
            {images3.map((image, index) => (
              <Image
                key={index}
                source={{ uri: image }}
                style={style.image}
              ></Image>
            ))}
          </ScrollView>
          <View style={style.pagination}>
            {images3.map((i, k) => (
              <Text
                key={k}
                style={
                  k == this.state.active
                    ? style.pagingActiveText
                    : style.pagingText
                }
              >
                •
              </Text>
            ))}
          </View>
        </View>
      </ScrollView>
    );
  }
}

export default HomePage;

const style = StyleSheet.create({
  pagination: {
    flexDirection: "row",
    position: "absolute",
    bottom: 0,
    alignSelf: "center",
  },

  pagingText: {
    color: "#888",
    margin: 3,
  },

  pagingActiveText: {
    color: "#fff",
    margin: 3,
  },

  pagingText2: {
    color: "#888",
    margin: 3,
  },

  pagingActiveText: {
    color: "#fff",
    margin: 3,
  },

  scroll: {
    width,
    height,
  },

  container: {
    marginTop: 5,
    width,
    height,
  },

  image: {
    width,
    height,
    resizeMode: "cover",
  },
});
